import React from 'react';
import Paper from '@material-ui/core/Paper';
import Box from '@material-ui/core/Box';

export const ScoreCard = ({name, score, recommended}) => {
    return (
        <Paper elevation={3} style={{ borderRadius: '0', borderLeft: '1px solid #2979FF'}}>
            <h3>Friends that you're seeing</h3>
            <h1>700</h1>
        </Paper>
    )
};

export default ScoreCard;
